/// Get pitch accents for a word given its reading and text
pub fn get_pitch_accents(reading: &str, text: &str) -> Vec<u8> {
    NHK_PITCH_DATA
        .iter()
        .find(|(r, t, _)| *r == reading && *t == text)
        .map(|(_, _, pitches)| pitches.to_vec())
        .unwrap_or_default()
}

